  `refund_amt` decimal(19, 2) NULL DEFAULT 0.00 COMMENT '退费总金额',
  `total_count` int(11) NULL DEFAULT 0 COMMENT '交易总笔数',
  `income_count` int(11) NULL DEFAULT 0 COMMENT '收费总比数',
  `refund_count` int(11) NULL DEFAULT 0 COMMENT '退费总比数',
  `fee` decimal(19, 4) NULL DEFAULT 0.0000 COMMENT '手续费',
  `pay_way` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '支付方式',
  `bank_code` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `merchant_no` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 286 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

