CREATE TABLE `pay_order_handle`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `handle_sn` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '处理流水号',
  `handle_type` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '处理类型',
