-- ----------------------------
DROP TABLE IF EXISTS `pay_order_onepay`;
CREATE TABLE `pay_order_onepay`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `apply_date` datetime(0) NULL DEFAULT NULL COMMENT '订单开始时间',
  `end_date` datetime(0) NULL DEFAULT NULL COMMENT '订单结束时间',
  `out_trade_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '平台订单号',
  `body` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单标题',
  `payway` int(11) NULL DEFAULT NULL COMMENT '支付方式',
  `shorturl` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '订单url',
  `state` int(11) NULL DEFAULT NULL COMMENT '订单状态',
  `timeout` int(11) NULL DEFAULT NULL COMMENT '订单超时时间',
  `trade_no` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '交易流水号（微信、支付宝）',
  `total_fee` int(11) NULL DEFAULT NULL COMMENT '订单金额',
  `merchant_id` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '商户编号',
  `ip` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '下单ip地址',
  `timestamp` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '下单时间戳',
  `bus_type` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '业务类型',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '一码付订单表' ROW_FORMAT = Compact;

