  `ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '权限ID',
  `PERMISSION_CONTENT` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '权限',
