  `FEE_AMT` decimal(16, 2) NULL DEFAULT NULL COMMENT '手续费',
  `TRANS_FLAG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发生额标志',
  `CRDR_FLAG` varchar(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '借贷标志',
  `AMT` decimal(16, 2) NULL DEFAULT NULL COMMENT '交易金额',
  `BALANCE` decimal(16, 2) NULL DEFAULT NULL COMMENT '余额',
