  `service_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '方法名称',
  `req_xml` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '精宸请求入参',
  `res_xml` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '精宸返回参数',
  `bank_req_xml` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '银行请求入参',
  `bank_res_xml` text CHARACTER SET utf8 COLLATE utf8_general_ci NULL COMMENT '银行返回入参',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 2617 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '银企直联日志表' ROW_FORMAT = Compact;

